import React from 'react'
import styled from 'styled-components'
import {AiFillLinkedin} from 'react-icons/ai'
import {RiMailSendLine} from 'react-icons/ri'


const Heading =styled.div`
color:#fff;
display:flex;
justify-content:space-between;
align-items:center;
`
const LogoIcon =styled.h1`

`
const SocialIcons = styled.div`
display:flex;
justify-content:space-between;

`
const Icons = styled.div`
display:flex;
justify-content:space-between;
align-items:center;
font-size:17px;
p{
    padding-left:2vh;
}
    padding-left:10vh;

`
const Logo = () => {
    return (
        <Heading>
            <LogoIcon>Jeffrey</LogoIcon>
<SocialIcons>
<Icons>
<RiMailSendLine/>
<p>Email</p>
</Icons>
<Icons>
<AiFillLinkedin/>
<p>Linkden</p>
</Icons>


</SocialIcons>
        </Heading>
    )
}

export default Logo
